script: |
  super -f text -I q8289.spq | sort > q8289.out

inputs:
  - name: q8289.spq
    data: |
      SELECT DISTINCT - col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - ( + - 54 ) * col0 * 9 IS NOT NULL );
  - name: tab1

outputs:
  - name: q8289.out
    data: |
      -59
      -68
      -96
